import { createIcon } from "../icon/createIcon";

export const LockedSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="LockedSolidIcon">
    <path d="M8 0a2 2 0 0 1 2 2l-.001 2H12v8H0V4h2V2C2 .946 2.816.082 3.851.005L4 0h4zM6 6a1.5 1.5 0 0 0-.631 2.861l.131.054V10h1l.001-1.086A1.5 1.5 0 0 0 6 6zm2-5H4a1 1 0 0 0-.993.883L3 2v2h5.999L9 2a1 1 0 0 0-1-1z" />
  </svg>,
  "LockedSolid",
  "locked solid"
);
